description:
Liste des agences web et marketing en Martinique (972).
```
{
  "description": "Descripteur de données pour les entreprises en Martinique et en Guadeloupe",
  "source": "Données fournies par l'utilisateur",
  "fields": [
    {
      "name": "NOM",
      "type": "string",
      "description": "Le nom de l'entreprise"
    },
    {
      "name": "ADDRESS",
      "type": "string",
      "description": "L'adresse principale de l'entreprise"
    },
    {
      "name": "ADRESS2",
      "type": "string",
      "description": "L'adresse secondaire de l'entreprise, si applicable"
    },
    {
      "name": "CPO",
      "type": "integer",
      "description": "Le code postal de l'entreprise"
    },
    {
      "name": "CITY",
      "type": "string",
      "description": "La ville où se trouve l'entreprise"
    },
    {
      "name": "PHONE1",
      "type": "string",
      "description": "Le numéro de téléphone principal de l'entreprise"
    },
    {
      "name": "PHONE2",
      "type": "string",
      "description": "Le numéro de téléphone secondaire de l'entreprise"
    },
    {
      "name": "EMAIL",
      "type": "string",
      "description": "L'adresse e-mail de contact de l'entreprise"
    },
    {
      "name": "URL",
      "type": "string",
      "description": "L'URL du site web de l'entreprise"
    },
    {
      "name": "TYPE",
      "type": "string",
      "description": "Le type d'activité de l'entreprise (Marketing, Web, etc.)"
    }
  ],
  "format": "JSON",
  "encoding": "UTF-8"
}
```

**Données disponibles**
    Inscriptions relatives aux créations, modifications, cessations des entreprises agricoles, artisanales, commerciales et libérales déposées à l'INPI et enregistrées au registre national des entreprises ;
    - Stock des dossiers des personnes morales et physiques actives à jour à la date du 4 mai  2017 pour pour les entreprises commerciales (stock) ;
    - Nouvelles inscriptions transmises par les entreprises (données de flux) ;
    - Données non confidentielles saisies à partir des comptes annuels déposés depuis le 1er janvier 2017 (données relatives aux bilans (actif/passif), comptes de résultat, immobilisations, amortissements et provisions, et transmis à l’INPI dans le cadre de ses missions pour les entreprises commerciales ;
    Actes et statuts des personnes morales et physiques depuis 1993 (stock).
**A compter du 1er janvier 2023**, le format des données mises à disposition sur les entreprises change avec la mise en place du Registre national des entreprises, qui succède au RNCS en application de la loi PACTE. Le nouveau format, basé sur le JSON.
